import React from "react";
import {useTrail, animated} from 'react-spring';

//import components
import Quote from "./quote";

function QuotesPage({tempQuote, setTempQuote}){
    function addNewQuote(){

    }
    return(
        <div>
            <header>
                <form className="log-out-form">
                    <button>Log Out</button>
                </form>

                <div className="title-line">
                    <h1>Ever's Quotes</h1>
                    <button onClick={addNewQuote}>Add a Quote</button>
                </div>
            </header>

            <Quote/>
            <Quote/>
            <Quote/>

            {tempQuote.map((item, index) => (
                <Quote
                    key={index}
                    dotNum={item.dotNum}
                    pwrNum={item.pwrNum}
                    pwrVal={item.pwrVal}
                    prmAmt={item.prmAmt}
                    prmTax={item.prmTax}
                    prmTot={item.prmTot}
                    street={item.street}
                    city={item.city}
                    state={item.state}
                    zip={item.zip}
                    fName={item.drvrName}
                    lName={item.lName}
                    age={item.age}
                />
            ))}
        </div>
    );
}

export default QuotesPage;
